import React from "react"
class Home extends React.Component{
    render(){
        const{cases}=this.props;
        console.log("home",cases)
        return(
            <>
            {cases.map((country)=>(
                <>
                <div className="Home-div">
                <div className="cases"><p>{country.Country}</p></div>
                <div className="cases"><p>{country.TotalConfirmed}</p></div>
                <div className="cases">{country.TotalRecovered}</div>
                <div className="cases">{country.TotalDeaths}</div>
                <div className="cases">{country.NewConfirmed}</div>
                <div className="cases">{country.NewRecovered}</div>
                <div className="cases">{country.Date}</div>

            </div>
                </>
            ))}
           
            </>
        )
    }
}
export default Home;
